import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';

const LoginPage = () => {
  const [email, setEmail] = useState('');
  const navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!email) return;
    // Simulate login step
    setTimeout(() => {
      navigate('/');
    }, 1000);
  };

  return (
    <div style={{ minHeight: '100vh', background: '#fff', display: 'flex', flexDirection: 'column' }}>
      <main style={{ flex: 1, display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center' }}>
        <form onSubmit={handleSubmit} style={{ width: '100%', maxWidth: 400, margin: '0 auto', background: 'none', boxShadow: 'none', padding: 0 }}>
          <h1 style={{ fontSize: '2.2rem', fontWeight: 700, marginBottom: 24, textAlign: 'left' }}>Sign In</h1>
          <label htmlFor="login-email" style={{ fontWeight: 500, fontSize: 16, marginBottom: 8, display: 'block' }}>Email <span title="Required" style={{ fontSize: 14, color: '#888', marginLeft: 4 }}>ⓘ</span></label>
          <input id="login-email" type="email" value={email} onChange={e => setEmail(e.target.value)} required style={{ width: '100%', padding: '12px 16px', fontSize: 18, borderRadius: 6, border: '1px solid #ddd', marginBottom: 24, background: '#fafafa' }} />
          <button type="submit" style={{ width: '100%', background: '#a3bffa', color: '#222', fontWeight: 600, fontSize: 18, borderRadius: 6, padding: '14px 0', border: 'none', marginBottom: 18, cursor: 'pointer' }}>Next</button>
          <div style={{ textAlign: 'center', marginBottom: 18 }}>
            <a href="#" style={{ color: '#222', textDecoration: 'underline', fontSize: 15 }}>Trouble Signing In?</a>
          </div>
          <div style={{ display: 'flex', alignItems: 'center', margin: '24px 0' }}>
            <div style={{ flex: 1, height: 1, background: '#eee' }}></div>
            <span style={{ margin: '0 16px', color: '#888', fontWeight: 500 }}>Or</span>
            <div style={{ flex: 1, height: 1, background: '#eee' }}></div>
          </div>
          <Link to="/signup" style={{ width: '100%', display: 'block', background: '#f5f5f5', color: '#222', fontWeight: 600, fontSize: 18, borderRadius: 6, padding: '14px 0', border: 'none', textAlign: 'center', textDecoration: 'none', marginBottom: 8, cursor: 'pointer' }}>Create Account</Link>
        </form>
      </main>
      <footer style={{ textAlign: 'center', color: '#888', fontSize: 15, padding: '32px 0 16px 0' }}>
        Tesla © 2025 &nbsp; Privacy & Legal &nbsp; Contact
      </footer>
    </div>
  );
};

export default LoginPage;
